description:
The Wedded Bliss computer dating agency aims to bring together the lonely hearts of Much-Snoggin-in-the-Green. Its owner, Sidney Bliss, has enough complications in his own love life, but still produces a pamphlet called \&quot;The Wit to Woo\&quot;. The strange collection of hopefuls lead to some outlandish matches, and jealousies are bound to lead to trouble.

